import React from "react";
import styled from "styled-components";
import Profile from "./Profile";
import { motion } from "framer-motion";

// const Wrapper = styled.section`
//   display: flex;
//   flex: 1 1;
//   width: 100%;
//   height: 100%;
// `;
// const Row = styled.div`
//   flex: 1;
//   flex-direction: row;
//   width: 100%;
// `;
// const Col = styled.div`
//   flex: 1;
//   flex-direction: column;
//   border: 2px;
// `;

const home = () => {
  return (
    <div>
      <div
        class="overlaid-content"
        data-text-effect="rotate_in"
        data-alignment="center"
        data-alignment-v="middle"
        style="height: 1329px; will-change: auto;"
      >
        <div class="container">
          <div class="row">
            <div class="col span_6">
              <div class="inner-wrap">
                <h1 class="top-heading">
                  <span class="wraped">
                    <span style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;">
                      Not
                    </span>
                  </span>
                  <span class="wraped">
                    <span style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;">
                      Your
                    </span>
                  </span>
                  <br />
                  <span class="wraped">
                    <span style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;">
                      Average
                    </span>
                  </span>
                  <br />
                  <span class="wraped">
                    <span style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;">
                      Software
                    </span>
                  </span>
                  <br />
                  <span class="wraped">
                    <span style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;">
                      Engineer
                    </span>
                  </span>
                </h1>
                <span
                  class="subheader"
                  style="transform: rotateX(0deg) translate(0px, 0px); opacity: 1;"
                >
                  Get ready to turn your <i>ideas</i> into <i>reality</i>
                </span>
              </div>
            </div>
          </div>
        </div>
        <div class="scroll-down-wrap">
          <a href="#" class="section-down-arrow">
            <i class="fa fa-angle-down top"></i>
            <i class="fa fa-angle-down"></i>
          </a>
        </div>
      </div>
    </div>
  );
};

export default home;
